  display:flex;align-items:center;justify-content:center;
  font-size:1.15rem;color:var(--ic-fg);
  margin-bottom:.875rem;
  box-shadow:0 4px 0 rgba(0,0,0,.1),0 6px 12px rgba(0,0,0,.08);
  transition:all .3s cubic-bezier(.4,0,.2,1);
  position:relative;z-index:1;
}
.stat-card:hover .stat-icon{
  transform:rotate(-8deg) scale(1.15) translateY(-3px);
  box-shadow:0 6px 0 rgba(0,0,0,.12),0 10px 16px rgba(0,0,0,.12);
}

.stat-card.s-total .stat-icon{--ic-bg:#FDECEA;--ic-fg:var(--maroon);}
.stat-card.s-pend  .stat-icon{--ic-bg:var(--gold-pale);--ic-fg:#92600A;}
.stat-card.s-prog  .stat-icon{--ic-bg:#EBF5FB;--ic-fg:#154360;}
.stat-card.s-done  .stat-icon{--ic-bg:#EAFAF1;--ic-fg:#145A32;}

.stat-num{
  font-family:'Poppins',sans-serif;
  font-size:2.4rem;font-weight:800;
  color:var(--txt1);line-height:1;
  margin-bottom:.2rem;
  position:relative;z-index:1;
  transition:color .3s;
}
.stat-card:hover .stat-num{color:var(--sk);}
.stat-lbl{font-size:.7rem;text-transform:uppercase;letter-spacing:1.2px;color:var(--txt3);font-weight:700;position:relative;z-index:1;}

/* ─── SECTION HEADER ───────────────────────────── */
.section-h{display:flex;align-items:center;justify-content:space-between;margin-bottom:1.1rem;}
.section-h h2{font-family:'Poppins',sans-serif;font-size:1rem;font-weight:700;color:var(--txt1);display:flex;align-items:center;gap:.45rem;}
.section-h h2 i{color:var(--maroon);font-size:.9rem;}

/* ─── PANEL ────────────────────────────────────── */
.panel{
  background:var(--surface);border-radius:var(--r3);
  border:1px solid var(--border);
  box-shadow:var(--sh1);overflow:hidden;
  transition:box-shadow .25s;
}
.panel:hover{box-shadow:var(--sh2);}
.panel-head{
  padding:1.1rem 1.4rem;
  border-bottom:1px solid var(--border);
  display:flex;align-items:center;justify-content:space-between;
  background:linear-gradient(to right,var(--surface2),var(--surface));
}
.panel-head h3{
  font-family:'Poppins',sans-serif;font-size:.94rem;font-weight:700;
  color:var(--txt1);display:flex;align-items:center;gap:.4rem;margin:0;
}
.panel-head h3 i{color:var(--maroon);}

/* ─── FILTER BAR ───────────────────────────────── */
.filter-bar{padding:.8rem 1.1rem;display:flex;gap:.6rem;align-items:center;flex-wrap:wrap;border-bottom:1px solid var(--border);background:var(--surface2);}
.sw{position:relative;flex:1;min-width:160px;}
.sw i{position:absolute;left:.75rem;top:50%;transform:translateY(-50%);color:var(--txt3);font-size:.78rem;}
.search-in{width:100%;padding:.48rem .75rem .48rem 2rem;background:var(--surface);border:1.5px solid var(--border);border-radius:var(--r1);font-size:.82rem;color:var(--txt1);font-family:'Nunito',sans-serif;outline:none;transition:border-color .2s;box-shadow:0 1px 0 var(--border);}
.search-in:focus{border-color:var(--maroon);box-shadow:0 0 0 3px rgba(123,29,29,.07);}
.f-sel{padding:.48rem .75rem;background:var(--surface);border:1.5px solid var(--border);border-radius:var(--r1);font-size:.82rem;color:var(--txt2);font-family:'Nunito',sans-serif;outline:none;cursor:pointer;box-shadow:0 1px 0 var(--border);}

/* ─── TABLE ────────────────────────────────────── */
.tbl{width:100%;border-collapse:collapse;}
.tbl thead th{padding:.65rem 1.1rem;font-size:.67rem;text-transform:uppercase;letter-spacing:1px;color:var(--txt3);font-weight:800;text-align:left;background:var(--surface2);border-bottom:1.5px solid var(--border);white-space:nowrap;}
.tbl tbody td{padding:.8rem 1.1rem;font-size:.83rem;color:var(--txt1);border-bottom:1px solid var(--border);vertical-align:middle;}
.tbl tbody tr:last-child td{border-bottom:none;}
.tbl tbody tr{transition:background .12s,transform .12s;}
.tbl tbody tr:hover td{background:var(--surface2);}
.equip-n{font-weight:700;}
.equip-s{font-size:.7rem;color:var(--txt3);margin-top:1px;}
.rid{font-family:'Poppins',sans-serif;font-weight:800;color:var(--maroon);font-size:.82rem;}

/* ─── STATUS BADGES ────────────────────────────── */
.badge{display:inline-flex;align-items:center;gap:.3rem;padding:.28rem .72rem;border-radius:20px;font-size:.69rem;font-weight:800;text-transform:uppercase;letter-spacing:.4px;white-space:nowrap;transition:all .2s;}
.badge:hover{transform:scale(1.04);}
.badge::before{content:'';width:6px;height:6px;border-radius:50%;background:currentColor;animation:dot 2s ease-in-out infinite;}
@keyframes dot{0%,100%{opacity:1;transform:scale(1);}50%{opacity:.5;transform:scale(.8);}}
.b-pend{background:var(--pending-bg);color:var(--pending-c);}
.b-prog{background:var(--prog-bg);   color:var(--prog-c);}
.b-done{background:var(--done-bg);   color:var(--done-c);}
.b-rej {background:var(--reject-bg); color:var(--reject-c);}

/* ─── NOTIFICATION ITEMS ───────────────────────── */
.notif-list{padding:.5rem;}
.notif-item{padding:.875rem 1.1rem;border-radius:var(--r2);cursor:pointer;transition:all .18s;display:flex;gap:.75rem;margin-bottom:.3rem;position:relative;}
.notif-item:hover{background:var(--surface2);}
.notif-item.unread{background:linear-gradient(to right,rgba(212,160,23,.08),transparent);}
.notif-item.unread::before{content:'';position:absolute;left:0;top:.875rem;bottom:.875rem;width:3px;background:linear-gradient(to bottom,var(--gold),var(--gold-l));border-radius:2px;}
.notif-ic{width:36px;height:36px;flex-shrink:0;border-radius:var(--r1);background:var(--surface2);display:flex;align-items:center;justify-content:center;font-size:.88rem;color:var(--maroon);box-shadow:0 2px 0 var(--border);transition:transform .2s;}
.notif-item:hover .notif-ic{transform:scale(1.1) rotate(-5deg);}
.notif-body strong{display:block;font-size:.84rem;color:var(--txt1);font-weight:700;}
.notif-body p{font-size:.76rem;color:var(--txt2);margin-top:.12rem;line-height:1.45;}
.notif-time{font-size:.68rem;color:var(--txt3);margin-top:.3rem;display:flex;align-items:center;gap:.2rem;}
.notif-empty{text-align:center;padding:3rem 1.5rem;color:var(--txt3);}
.notif-empty i{font-size:2.5rem;margin-bottom:.75rem;opacity:.25;display:block;}

/* ─── PROFILE ──────────────────────────────────── */
.profile-grid{display:grid;grid-template-columns:1fr 1.65fr;gap:1.375rem;}
.p-card{background:var(--surface);border-radius:var(--r3);border:1px solid var(--border);overflow:hidden;box-shadow:var(--sh1);}
.p-header{
  position:relative;overflow:hidden;padding:0;
  min-height:160px;
}
.p-header-bg{
  position:absolute;inset:0;
  background-image:url('data:image/png;base64,');
  background-size:cover;background-position:center;
  filter:brightness(.3) saturate(1.2);
}
.p-header-ov{position:absolute;inset:0;background:linear-gradient(135deg,rgba(82,16,16,.95),rgba(123,29,29,.88));}
.p-header-content{position:relative;z-index:1;padding:1.75rem;text-align:center;}
.p-avatar-lg{
  width:82px;height:82px;
  background:linear-gradient(135deg,var(--gold) 0%,#E8B820 50%,var(--maroon-l) 100%);
  border-radius:50%;
  margin:0 auto .875rem;
  display:flex;align-items:center;justify-content:center;
  font-family:'Poppins',sans-serif;font-size:2rem;font-weight:800;color:#fff;
  border:3px solid rgba(255,255,255,.2);
  box-shadow:0 6px 0 rgba(0,0,0,.25),0 10px 20px rgba(0,0,0,.15);
  transition:transform .3s;
}
.p-header:hover .p-avatar-lg{transform:scale(1.08) rotate(-3deg);}
.p-header h2{font-family:'Poppins',sans-serif;font-size:1.2rem;font-weight:800;color:#fff;}
.p-header p{color:rgba(255,255,255,.5);font-size:.78rem;margin-top:.2rem;}
.p-body{padding:1.35rem 1.5rem;}
.d-row{display:flex;gap:1.1rem;padding:.58rem 0;border-bottom:1px solid var(--border);align-items:flex-start;}
.d-row:last-child{border:none;}
.d-k{width:110px;flex-shrink:0;font-size:.7rem;font-weight:800;text-transform:uppercase;letter-spacing:.7px;color:var(--txt3);padding-top:.15rem;}
.d-v{font-size:.86rem;color:var(--txt1);flex:1;}
.forms-stack{display:flex;flex-direction:column;gap:1.25rem;}

/* ─── FORM ─────────────────────────────────────── */
.f-row{display:grid;grid-template-columns:1fr 1fr;gap:.875rem;}
.f-group{display:flex;flex-direction:column;gap:.38rem;margin-bottom:.875rem;}
.f-group.full{grid-column:1/-1;}
.f-label{font-size:.72rem;font-weight:800;text-transform:uppercase;letter-spacing:.8px;color:var(--txt2);}
.f-label span{color:var(--maroon);}
.f-ctrl{
  padding:.58rem .875rem;
  background:var(--surface);
  border:1.5px solid var(--border);
  border-radius:var(--r1);
  font-size:.86rem;color:var(--txt1);
  font-family:'Nunito',sans-serif;
  outline:none;
  transition:border-color .2s,box-shadow .2s;
  box-shadow:0 2px 0 var(--surface2);
}
.f-ctrl:focus{border-color:var(--maroon);box-shadow:0 0 0 3px rgba(123,29,29,.08);}
.f-ctrl::placeholder{color:var(--txt3);}
.f-ctrl:read-only{background:var(--surface2);color:var(--txt3);}
textarea.f-ctrl{resize:vertical;min-height:90px;}

.upload-zone{
  border:2px dashed var(--border);border-radius:var(--r2);
  padding:1.75rem;text-align:center;cursor:pointer;
  transition:all .2s;background:var(--surface2);
  position:relative;overflow:hidden;
}
.upload-zone::before{
  content:'';position:absolute;inset:0;
  background:linear-gradient(135deg,rgba(123,29,29,.03),transparent);
  opacity:0;transition:opacity .2s;
}
.upload-zone:hover{border-color:var(--maroon);background:#FDECEA;}
.upload-zone:hover::before{opacity:1;}
.upload-zone i{font-size:2rem;color:var(--txt3);margin-bottom:.6rem;display:block;transition:transform .3s,color .3s;}
.upload-zone:hover i{transform:scale(1.15) translateY(-3px);color:var(--maroon);}
.upload-zone p{font-size:.82rem;color:var(--txt2);font-weight:600;}
.upload-zone small{font-size:.72rem;color:var(--txt3);}
#imgPrev{margin-top:.875rem;display:none;border-radius:var(--r1);overflow:hidden;}
#imgPrev img{width:100%;max-height:170px;object-fit:cover;display:block;}
.f-err{color:var(--reject-c);font-size:.72rem;margin-top:.22rem;display:none;}

/* ─── MODAL ────────────────────────────────────── */
.mo{position:fixed;inset:0;background:rgba(26,10,10,.6);backdrop-filter:blur(6px);z-index:500;display:none;align-items:center;justify-content:center;padding:1rem;}
.mo.open{display:flex;animation:moIn .18s ease;}
@keyframes moIn{from{opacity:0}to{opacity:1}}
.modal{background:var(--surface);border-radius:var(--r4);width:100%;max-width:590px;max-height:90vh;overflow-y:auto;box-shadow:var(--sh3);animation:mUp .28s cubic-bezier(.4,0,.2,1);border:1px solid var(--border);}
.modal::-webkit-scrollbar{width:5px;}
.modal::-webkit-scrollbar-thumb{background:var(--border);border-radius:4px;}
@keyframes mUp{from{transform:translateY(22px);opacity:0}to{transform:translateY(0);opacity:1}}
.m-head{padding:1.5rem 1.75rem 1.25rem;display:flex;justify-content:space-between;align-items:flex-start;background:linear-gradient(115deg,var(--maroon-d),var(--maroon));border-radius:var(--r4) var(--r4) 0 0;position:relative;overflow:hidden;}
/* Gear decoration in modal header */
.m-head::after{content:'\f013';font-family:"Font Awesome 6 Free";font-weight:900;position:absolute;right:-15px;bottom:-25px;font-size:90px;color:rgba(255,255,255,.05);animation:gearSpin 20s linear infinite;}
.m-head-txt h2{font-family:'Poppins',sans-serif;font-size:1.15rem;font-weight:800;color:#fff;position:relative;z-index:1;}
.m-head-txt p{font-size:.76rem;color:rgba(255,255,255,.45);margin-top:.18rem;position:relative;z-index:1;}
.m-close{width:30px;height:30px;background:rgba(255,255,255,.1);border:none;border-radius:50%;color:rgba(255,255,255,.65);font-size:.9rem;cursor:pointer;transition:all .18s;display:flex;align-items:center;justify-content:center;flex-shrink:0;position:relative;z-index:1;}
.m-close:hover{background:rgba(255,255,255,.22);color:#fff;transform:rotate(90deg);}
.m-body{padding:1.75rem;}
.m-foot{padding:1.1rem 1.75rem 1.5rem;border-top:1px solid var(--border);display:flex;justify-content:flex-end;gap:.6rem;}

/* Confirm box */
.cbox{background:var(--surface);border-radius:var(--r4);width:100%;max-width:380px;padding:2.25rem;text-align:center;box-shadow:var(--sh3);animation:mUp .28s cubic-bezier(.4,0,.2,1);}
.cbox-icon{font-size:3rem;margin-bottom:.875rem;display:block;}
.cbox h3{font-family:'Poppins',sans-serif;font-size:1.2rem;font-weight:800;margin-bottom:.4rem;}
.cbox p{font-size:.84rem;color:var(--txt2);margin-bottom:1.4rem;line-height:1.6;}
.cbox-actions{display:flex;gap:.6rem;justify-content:center;}

/* Detail rows */
.dr{display:flex;gap:1.1rem;padding:.58rem 0;border-bottom:1px solid var(--border);align-items:flex-start;}
.dr:last-child{border:none;}
.dk{width:125px;flex-shrink:0;font-size:.7rem;font-weight:800;text-transform:uppercase;letter-spacing:.7px;color:var(--txt3);}
.dv{font-size:.87rem;color:var(--txt1);flex:1;}

/* Progress timeline */
.timeline{padding:.5rem 0;}
.tl-step{display:flex;gap:.875rem;align-items:flex-start;position:relative;padding-bottom:1.25rem;}
.tl-step:last-child{padding-bottom:0;}
.tl-step:not(:last-child)::before{content:'';position:absolute;left:16px;top:34px;bottom:0;width:2px;background:var(--border);}
.tl-step.done .tl-step:not(:last-child)::before{background:var(--done-c);}
.tl-dot{width:34px;height:34px;border-radius:50%;flex-shrink:0;display:flex;align-items:center;justify-content:center;font-size:.8rem;font-weight:700;box-shadow:0 2px 0 rgba(0,0,0,.1);}
.tl-dot.active{background:linear-gradient(135deg,var(--maroon),var(--maroon-l));color:#fff;box-shadow:0 2px 0 var(--maroon-d),0 0 12px rgba(123,29,29,.3);animation:tlPulse 2s ease-in-out infinite;}
.tl-dot.done{background:linear-gradient(135deg,#145A32,#1D8348);color:#fff;}
.tl-dot.pending-st{background:var(--gold-pale);color:var(--gold);}
@keyframes tlPulse{0%,100%{box-shadow:0 2px 0 var(--maroon-d),0 0 12px rgba(123,29,29,.3);}50%{box-shadow:0 2px 0 var(--maroon-d),0 0 22px rgba(123,29,29,.5);}}
.tl-text strong{display:block;font-size:.83rem;font-weight:700;color:var(--txt1);}
.tl-text span{font-size:.73rem;color:var(--txt3);}

/* ─── TOAST ────────────────────────────────────── */
.toast-tray{position:fixed;bottom:1.75rem;right:1.75rem;display:flex;flex-direction:column;gap:.45rem;z-index:9999;}
.toast{
  background:var(--surface);border:1px solid var(--border);
  border-radius:var(--r2);padding:.875rem 1.1rem;
  display:flex;align-items:flex-start;gap:.65rem;
  box-shadow:var(--sh3);min-width:265px;
  animation:tIn .25s cubic-bezier(.4,0,.2,1);
  border-left:4px solid var(--maroon);
}
.toast.ok{border-left-color:#145A32;}
.toast.err{border-left-color:#7B241C;}
@keyframes tIn{from{transform:translateX(80px);opacity:0}to{transform:translateX(0);opacity:1}}
.toast i{font-size:1rem;color:var(--maroon);margin-top:1px;}
.toast.ok i{color:#145A32;}
.toast.err i{color:#7B241C;}
.toast-t{font-size:.83rem;font-weight:700;color:var(--txt1);}
.toast-m{font-size:.74rem;color:var(--txt2);margin-top:1px;}

/* ─── RESPONSIVE ───────────────────────────────── */
@media(max-width:1100px){.stats-grid{grid-template-columns:repeat(2,1fr);}.profile-grid{grid-template-columns:1fr;}}
@media(max-width:768px){
  .sidebar{transform:translateX(-100%);}
  .sidebar.open{transform:translateX(0);}
  .main{margin-left:0;}
  .content{padding:1.25rem 1rem;}
  .topbar{padding:0 1rem;}
  .mobile-btn{display:flex;}
  .hero-mascot{width:90px;}
  .hero-title{font-size:1.45rem;}
  .stats-grid{grid-template-columns:1fr 1fr;}
  .f-row{grid-template-columns:1fr;}
  .date-pill{display:none;}
}
</style>
