<script>
// ── CONSTANTS ──────────────────────────────────────────────────────
const PAGE_TITLES = {dashboard:'Dashboard',history:'Report History',notifications:'Notifications',profile:'My Profile'};
let allReports = [];

// ── BOOT ───────────────────────────────────────────────────────────
document.addEventListener('DOMContentLoaded', () => {
  const now = new Date();
  document.getElementById('dateChip').textContent =
    now.toLocaleDateString('en-US',{weekday:'short',month:'short',day:'numeric',year:'numeric'});
  document.getElementById('fDate').value =
    now.toLocaleDateString('en-US',{month:'long',day:'numeric',year:'numeric'});

  // Inject user info from PHP
  const name = <?php echo json_encode($user_name); ?>;
  const initials = <?php echo json_encode($initials); ?>;
  document.getElementById('sideUser').textContent = name;
  document.getElementById('sideAvatar').textContent = initials;

  loadStats();
  loadRecent();

  // Auto-refresh every 30s
  setInterval(() => {
    loadStats();
    if (document.getElementById('page-dashboard').classList.contains('active')) loadRecent();
    if (document.getElementById('page-history').classList.contains('active')) loadHist();
    if (document.getElementById('page-notifications').classList.contains('active')) loadNotifs();
  }, 30000);
});

// ── NAVIGATION ─────────────────────────────────────────────────────
function showPage(name, btn) {
  document.querySelectorAll('.page').forEach(p => p.classList.remove('active'));
  document.querySelectorAll('.nav-item').forEach(n => n.classList.remove('active'));
  const pg = document.getElementById('page-' + name);
  if (pg) pg.classList.add('active');
  document.getElementById('topTitle').textContent = PAGE_TITLES[name] || name;
  document.getElementById('topBreadcrumb').textContent = PAGE_TITLES[name] || name;
  if (btn) btn.classList.add('active');
  if (name==='history')       loadHist();
  if (name==='notifications') loadNotifs();
  if (window.innerWidth < 769) document.getElementById('sidebar').classList.remove('open');
}

function toggleSidebar() {
  document.getElementById('sidebar').classList.toggle('open');
}
document.addEventListener('click', e => {
  const sb = document.getElementById('sidebar');
  if (window.innerWidth < 769 && sb.classList.contains('open') && !sb.contains(e.target))
    sb.classList.remove('open');
});

// ── API: STATS ─────────────────────────────────────────────────────
function loadStats() {
  fetch('api/student_dashboard_api.php?action=get_stats')
    .then(r=>r.json()).then(d=>{
      if (!d.success || !d.data) return;
      const s = d.data;
      animN('st-t', s.total_reports||0);
      animN('st-p', s.pending_reports||0);
      animN('st-i', s.in_progress_reports||0);
      animN('st-d', s.completed_reports||0);
      const u = s.unread_notifications||0;
      document.getElementById('navBadge').textContent = u;
      document.getElementById('navBadge').style.display = u>0?'inline-flex':'none';
      document.getElementById('topPip').style.display = u>0?'block':'none';
      document.getElementById('pR').textContent = s.total_reports||0;
    }).catch(()=>{});
}

// ── API: RECENT REPORTS ────────────────────────────────────────────
function loadRecent() {
  const ic = document.getElementById('rIcon');
  if (ic) ic.className = 'fas fa-spinner fa-spin';
  fetch('api/student_dashboard_api.php?action=get_reports&limit=5')
    .then(r=>r.json()).then(d=>{
      if (ic) ic.className = 'fas fa-sync-alt';
      const tb = document.getElementById('recentBody');
      if (d.success && d.data && d.data.length>0) {
        tb.innerHTML = d.data.map(r=>rRow(r,6)).join('');
      } else {
        tb.innerHTML = emptyR(6,'No reports submitted yet. Click <strong>Report Defective Equipment</strong> to start.');
      }
    }).catch(()=>{
      if (ic) ic.className = 'fas fa-sync-alt';
      document.getElementById('recentBody').innerHTML = emptyR(6,'Unable to load reports. Please refresh.');
    });
}

// ── API: HISTORY ───────────────────────────────────────────────────
function loadHist() {
  fetch('api/student_dashboard_api.php?action=get_reports&limit=200')
    .then(r=>r.json()).then(d=>{
      allReports = (d.success && d.data) ? d.data : [];
      renderHist(allReports);
    }).catch(()=>{
      document.getElementById('histBody').innerHTML = emptyR(7,'Unable to load history.');
    });
}
function filterHist() {
  const q  = document.getElementById('hSearch').value.toLowerCase();
  const st = document.getElementById('hStatus').value;
  const so = document.getElementById('hSort').value;
  let f = [...allReports];
  if (q)  f = f.filter(r=>(r.equipment_name||'').toLowerCase().includes(q)||(r.report_id||r.id||'').toString().toLowerCase().includes(q));
  if (st) f = f.filter(r=>r.status===st);
  f.sort((a,b)=>{
    const da=new Date(a.report_date||a.date), db=new Date(b.report_date||b.date);
    return so==='asc'?da-db:db-da;
  });
  renderHist(f);
}
function renderHist(data) {
  const tb = document.getElementById('histBody');
  if (!data.length) { tb.innerHTML = emptyR(7,'No reports match your search.'); return; }
  tb.innerHTML = data.map(r=>`
    <tr>
      <td><span class="rid">${esc(r.report_id||r.id)}</span></td>
      <td><div class="equip-n">${esc(r.equipment_name)}</div></td>
      <td><span class="equip-s">${esc(r.category||'—')}</span></td>
      <td>${esc(r.location||'—')}</td>
      <td>${fd(r.report_date||r.date)}</td>
      <td>${bdg(r.status)}</td>
      <td><button class="btn btn-outline btn-sm" onclick="openDetail(${JSON.stringify(r).replace(/"/g,'&quot;')})"><i class="fas fa-eye"></i> Details</button></td>
    </tr>
  `).join('');
}

// ── API: NOTIFICATIONS ─────────────────────────────────────────────
function loadNotifs() {
  fetch('api/student_dashboard_api.php?action=get_notifications&limit=30')
    .then(r=>r.json()).then(d=>{
      const el = document.getElementById('notifList');
      if (d.success && d.data && d.data.length>0) {
        el.innerHTML = d.data.map(n=>`
          <div class="notif-item ${n.is_read==0?'unread':''}" onclick="readN(${n.id})">
            <div class="notif-ic"><i class="fas fa-${nIcon(n.type)}"></i></div>
            <div class="notif-body">
              <strong>${esc(n.title)}</strong>
              <p>${esc(n.message)}</p>
              <div class="notif-time"><i class="far fa-clock"></i> ${relT(n.created_at)}</div>
            </div>
          </div>
        `).join('');
      } else {
        el.innerHTML = '<div class="notif-empty"><i class="fas fa-bell-slash"></i><p>No notifications yet.</p></div>';
      }
    }).catch(()=>{
      document.getElementById('notifList').innerHTML='<div class="notif-empty"><i class="fas fa-exclamation-circle"></i><p>Could not load notifications.</p></div>';
    });
}
function nIcon(t){return {defect_report:'exclamation-triangle',system:'info-circle',completed:'check-circle',rejected:'times-circle'}[t]||'bell';}
function readN(id){
  fetch('api/student_dashboard_api.php',{method:'POST',headers:{'Content-Type':'application/x-www-form-urlencoded'},body:`action=mark_notification_read&notification_id=${id}`})
    .then(()=>{loadNotifs();loadStats();});
}
function markAllRead(){
  fetch('api/student_dashboard_api.php',{method:'POST',headers:{'Content-Type':'application/x-www-form-urlencoded'},body:'action=mark_all_read'})
    .then(()=>{loadNotifs();loadStats();toast('ok','All notifications marked as read.','Notifications');});
}

// ── REPORT FORM ────────────────────────────────────────────────────
function openReportModal(){
  clearErrs();
  document.getElementById('fDate').value=new Date().toLocaleDateString('en-US',{month:'long',day:'numeric',year:'numeric'});
  document.getElementById('reportModal').classList.add('open');
}
function closeReportModal(){document.getElementById('reportModal').classList.remove('open');}

function previewPhoto(e){
  const f=e.target.files[0],pe=document.getElementById('fPhotoE'),pv=document.getElementById('imgPrev');
  pe.style.display='none';
  if(!f)return;
  if(!['image/jpeg','image/png'].includes(f.type)){pe.textContent='⚠ Only JPG or PNG files accepted.';pe.style.display='block';return;}
  if(f.size>5*1024*1024){pe.textContent='⚠ File exceeds the 5 MB limit.';pe.style.display='block';return;}
  const r=new FileReader();r.onload=ev=>{document.getElementById('imgPrevImg').src=ev.target.result;pv.style.display='block';};r.readAsDataURL(f);
}

function openConfirm(){
  let ok=true;
  const v=(id,eid)=>{const el=document.getElementById(id),e=document.getElementById(eid),v2=el.value.trim()!='';e.style.display=v2?'none':'block';if(!v2)ok=false;};
  v('fEq','fEqE');v('fCat','fCatE');v('fLoc','fLocE');v('fDesc','fDescE');
  if(!ok){toast('err','Please fill in all required fields.','Validation Error');return;}
  document.getElementById('confirmModal').classList.add('open');
}
function closeCo(){document.getElementById('confirmModal').classList.remove('open');}

function doSubmit(){
  const fd2=new FormData();
  fd2.append('action','submit_report');
  fd2.append('equipment',document.getElementById('fEq').value.trim());
  fd2.append('category',document.getElementById('fCat').value);
  fd2.append('location',document.getElementById('fLoc').value.trim());
  fd2.append('description',document.getElementById('fDesc').value.trim());
  const ph=document.getElementById('fPhoto').files[0];
  if(ph)fd2.append('photo',ph);

  fetch('api/student_dashboard_api.php',{method:'POST',body:fd2})
    .then(r=>r.json()).then(d=>{
      closeCo();closeReportModal();
      if(d.success){
        toast('ok',`Report ${d.report_id||''} submitted! Status: Pending.`,'Submission Confirmed');
        loadStats();loadRecent();
        ['fEq','fCat','fLoc','fDesc','fPhoto'].forEach(id=>document.getElementById(id).value='');
        document.getElementById('imgPrev').style.display='none';
      } else {
        toast('err',d.message||'Submission failed.','Error');
      }
    }).catch(()=>{closeCo();toast('err','Network error. Please try again.','Error');});
}

function clearErrs(){['fEqE','fCatE','fLocE','fDescE'].forEach(id=>document.getElementById(id).style.display='none');}

// ── DETAIL MODAL ───────────────────────────────────────────────────
function openDetail(r){
  if(typeof r==='string')r=JSON.parse(r);
  const id=r.report_id||r.id;
  document.getElementById('detailSub').textContent=`Report ID: ${id}`;

  // Build timeline
  const steps=[
    {label:'Report Submitted',sub:'Your report has been received.',done:true},
    {label:'Admin Review',sub:'Waiting for administrator approval.',done:['in_progress','completed','rejected'].includes(r.status)},
    {label:'In Progress',sub:'Assigned to maintenance team.',done:['completed'].includes(r.status),active:r.status==='in_progress'},
    {label:'Completed',sub:r.remarks||'Repair completed successfully.',done:r.status==='completed'},
  ];
  if(r.status==='rejected')steps[1]={label:'Rejected',sub:r.remarks||'Report was rejected.',done:true};

  const tl=steps.map((s,i)=>`
    <div class="tl-step">
      <div class="tl-dot ${s.done?'done':s.active?'active':'pending-st'}">
        <i class="fas fa-${s.done?'check':s.active?'wrench':'clock'}"></i>
      </div>
      <div class="tl-text">
        <strong>${s.label}</strong>
        <span>${s.sub}</span>
      </div>
    </div>
  `).join('');

  document.getElementById('detailBody').innerHTML=`
    <div class="dr"><div class="dk">Equipment</div><div class="dv"><strong>${esc(r.equipment_name||r.equipment)}</strong></div></div>
    <div class="dr"><div class="dk">Category</div><div class="dv">${esc(r.category||'—')}</div></div>
    <div class="dr"><div class="dk">Location</div><div class="dv">${esc(r.location||'—')}</div></div>
    <div class="dr"><div class="dk">Date</div><div class="dv">${fd(r.report_date||r.date)}</div></div>
    <div class="dr"><div class="dk">Status</div><div class="dv">${bdg(r.status)}</div></div>
    <div class="dr"><div class="dk">Description</div><div class="dv">${esc(r.issue_description||r.description||r.desc||'—')}</div></div>
    ${r.remarks?`<div class="dr"><div class="dk">Remarks</div><div class="dv">${esc(r.remarks)}</div></div>`:''}
    ${(r.completion_date||r.completedDate)?`<div class="dr"><div class="dk">Completed</div><div class="dv">${fd(r.completion_date||r.completedDate)}</div></div>`:''}
    <div class="dr"><div class="dk">Progress</div><div class="dv"><div class="timeline">${tl}</div></div></div>
    ${r.photo_url?`<div class="dr"><div class="dk">Photo</div><div class="dv"><img src="${esc(r.photo_url)}" style="max-width:100%;border-radius:var(--r1);margin-top:.25rem;box-shadow:var(--sh1);"></div></div>`:''}
  `;
  document.getElementById('detailModal').classList.add('open');
}

// ── PROFILE ────────────────────────────────────────────────────────
function saveProfile(){
  const n=document.getElementById('eName').value.trim(),e=document.getElementById('eEmail').value.trim();
  if(!n||!e){toast('err','Name and email are required.','Validation');return;}
  fetch('api/student_dashboard_api.php',{method:'POST',headers:{'Content-Type':'application/x-www-form-urlencoded'},body:`action=update_profile&name=${encodeURIComponent(n)}&email=${encodeURIComponent(e)}`})
    .then(r=>r.json()).then(d=>{
      if(d.success){
        document.getElementById('profName').textContent=n;document.getElementById('profEmail').textContent=e;
        document.getElementById('pN').textContent=n;document.getElementById('pE').textContent=e;
        toast('ok','Profile updated.','Saved');
      }else toast('err',d.message||'Update failed.','Error');
    }).catch(()=>toast('err','Network error.','Error'));
}

function changePass(){
  const c=document.getElementById('pwC').value,n=document.getElementById('pwN').value,cf=document.getElementById('pwCf').value;
  if(!c||!n||!cf){toast('err','All password fields are required.','Validation');return;}
  if(n.length<8){toast('err','Password must be at least 8 characters.','Validation');return;}
  if(n!==cf){toast('err','New passwords do not match.','Validation');return;}
  fetch('api/student_dashboard_api.php',{method:'POST',headers:{'Content-Type':'application/x-www-form-urlencoded'},body:`action=change_password&current_password=${encodeURIComponent(c)}&new_password=${encodeURIComponent(n)}`})
    .then(r=>r.json()).then(d=>{
      if(d.success){['pwC','pwN','pwCf'].forEach(id=>document.getElementById(id).value='');toast('ok','Password updated.','Security');}
      else toast('err',d.message||'Failed.','Error');
    }).catch(()=>toast('err','Network error.','Error'));
}

// ── LOGOUT ─────────────────────────────────────────────────────────
function confirmLogout(){document.getElementById('logoutModal').classList.add('open');}

// ── HELPERS ────────────────────────────────────────────────────────
function rRow(r,cols){
  const id=r.report_id||r.id;
  return `<tr>
    <td><span class="rid">${esc(id)}</span></td>
    <td><div class="equip-n">${esc(r.equipment_name)}</div><div class="equip-s">${esc(r.category||'')}</div></td>
    <td>${esc(r.location||'—')}</td>
    <td>${fd(r.report_date||r.date)}</td>
    <td>${bdg(r.status)}</td>
    <td><button class="btn btn-outline btn-sm" onclick="openDetail(${JSON.stringify(r).replace(/"/g,'&quot;')})"><i class="fas fa-eye"></i> View</button></td>
  </tr>`;
}
function emptyR(c,msg){return `<tr><td colspan="${c}" style="text-align:center;padding:2rem;color:var(--txt3);">${msg}</td></tr>`;}
function bdg(s){const m={pending:['b-pend','Pending'],in_progress:['b-prog','In Progress'],completed:['b-done','Completed'],rejected:['b-rej','Rejected']};const[cl,lb]=m[s]||['b-pend',s];return `<span class="badge ${cl}">${lb}</span>`;}
function esc(s){if(s==null)return '—';const d=document.createElement('div');d.textContent=String(s);return d.innerHTML;}
function fd(d){if(!d)return'—';return new Date(d).toLocaleDateString('en-US',{month:'short',day:'numeric',year:'numeric'});}
function relT(d){if(!d)return'—';const m=Math.floor((Date.now()-new Date(d))/60000);if(m<1)return'Just now';if(m<60)return m+'m ago';const h=Math.floor(m/60);if(h<24)return h+'h ago';const dy=Math.floor(h/24);return dy<7?dy+'d ago':fd(d);}
function animN(id,t){const el=document.getElementById(id);if(!el)return;const s=parseInt(el.textContent)||0,t0=performance.now(),dur=700;const go=now=>{const p=Math.min((now-t0)/dur,1),e=1-Math.pow(1-p,3);el.textContent=Math.round(s+(t-s)*e);if(p<1)requestAnimationFrame(go);};requestAnimationFrame(go);}
function toast(type,msg,title){const i=type==='ok'?'check-circle':'exclamation-circle';const el=document.createElement('div');el.className=`toast ${type}`;el.innerHTML=`<i class="fas fa-${i}"></i><div><div class="toast-t">${title||''}</div><div class="toast-m">${msg}</div></div>`;document.getElementById('toasts').appendChild(el);setTimeout(()=>el.remove(),4500);}

// Backdrop close
document.querySelectorAll('.mo').forEach(o=>o.addEventListener('click',e=>{if(e.target===o)o.classList.remove('open');}));
</script>
</body>
</html>